  false,\n\t\"url\": null,\n\t\"notes\": \"The main phase of investigation at Karluk
  Lake in 1961 will be continued research into racial characteristics, fry survival
  in two diverse stream types, enumeration of smolts and mapping the extent of beach
  spawners. A final study of post fertilization conditions at Bare Lake will be made
  with emphasis placed on changes in abundance of the fish populations. Studies of
  the growth, distribution, and survival of Karluk Lake juvenile salmon will commence
  in 1961.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
